import React, { useState } from "react";


const Searchimg = ()=>{

    const [img, setImg] = useState();

    const inputEvent = (e)=>{
        const data = e.target.value;
        setImg(data);
    }

    return(
        <>
            <input type="text" placeholder="search Image" onChange={inputEvent} value={img}/>
        </>
    );
}

export default Searchimg;
